;; gorilla-repl.fileformat = 1

;; **
;;; # Cat detector!
;;; 
;;; In this short exercice you will learn how to use a classifier to find objects in a picture. 
;;; 
;;; The classifier, using a prepared haarcascade file, can recognize cat faces. The classifier is created using the origami function *new-cascadeclassifier* and the haarcascade xml configuration file.
;;; 
;;; The xml is the result of a training performed outside of this recipe, but the classifiers themselves are available and can readily be used within your application.
;; **

;; **
;;; ## Detecting cats ...
;; **

;; **
;;; We will start by getting the usual origami namespaces.:
;;; - core, is the main namespace and contains all the opencv imported function
;;; - utils, is custom made to bring a bit of sugar in your origami code
;;; - rgb, helps by bringing a set of usual colors ready to be used
;; **

;; @@
(ns catsdetector
  (:require
    [opencv4.utils :as u]
[opencv4.gorilla :as g]
    [opencv4.colors.rgb :as rgb]
    [opencv4.core :refer :all]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; @@
(def detector 
  (new-cascadeclassifier 
    "resources/XML/haarcascade_frontalcatface.xml"))

(defn apply-detector [mat]
  (let[ rects (new-matofrect)]
  (.detectMultiScale detector mat rects)
  (.toArray rects)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;catsdetector/apply-detector</span>","value":"#'catsdetector/apply-detector"}
;; <=

;; @@
(def cat (-> "resources/chapter02/emilie1.jpg" imread (u/resize-by 0.1)))
(doseq [r (apply-detector cat)] (println r))
;; @@
;; ->
;;; #object[org.opencv.core.Rect 0x37e0e {141, 53, 155x155}]
;;; 
;; <-
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; @@
(doseq [r (apply-detector cat)] (rectangle cat r rgb/white 2))
(g/>> cat)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"409\" height=\"307\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x64675f15 \"BufferedImage@64675f15: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@7d9bc538 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 409 height = 307 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; @@

(defn add-label! [buffer rects]
  (put-text! buffer (str (count (.toArray rects) ) " cat(s) " )
     (new-point 30 100) FONT_HERSHEY_PLAIN 2 rgb/magenta-2 2))

(defn draw-rects! [buffer rects]
   (doseq [r (.toArray rects)]
     (-> buffer
      (submat r)
      (apply-color-map! COLORMAP_WINTER)
      (copy-to (submat buffer r))))
      buffer)

(defn detect-cats! [mat]
  (let [  rects (new-matofrect) ]
   (.detectMultiScale detector mat rects)
   (-> mat
    (draw-rects! rects)
    (add-label! rects))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;catsdetector/detect-cats!</span>","value":"#'catsdetector/detect-cats!"}
;; <=

;; @@
(-> "https://raw.githubusercontent.com/hellonico/origami/master/doc/cat_in_bowl.jpeg"
    (u/mat-from-url)
    (u/resize-by 0.3)
    (detect-cats!)
    (opencv4.utils/mat-view))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"300\" height=\"199\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x70204bce \"BufferedImage@70204bce: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@7d9bc538 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 300 height = 199 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; @@
(-> "https://www.fetchpetcare.com/wp-content/uploads/2016/02/Cat-breeds-various-featured.jpg"
    (u/mat-from-url)
    (detect-cats!)
    (u/resize-by 0.6)
    (opencv4.utils/mat-view))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"540\" height=\"241\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x49c2f422 \"BufferedImage@49c2f422: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@7d9bc538 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 540 height = 241 #numDataElements 3 dataOff[0] = 2\"]"}
