;; **
;;; ## Detecting people faces
;; **

;; @@
(def faces-detector 
  (new-cascadeclassifier 
    "resources/XML2/haarcascade_frontalface_alt2.xml"))

(defn detect-faces! [mat]
  (let [  rects (new-matofrect) ]
   (.detectMultiScale faces-detector mat rects)
   (-> mat
    (draw-rects! rects)
    (add-label! rects))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;catsdetector/detect-faces!</span>","value":"#'catsdetector/detect-faces!"}
;; <=

;; @@
(-> "https://www.sciencenewsforstudents.org/sites/default/files/2016/12/main/articles/860_main_beauty.png"
    (u/mat-from-url)
    (u/resize-by 0.5)
    (detect-faces!)
    (g/>>))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"430\" height=\"230\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x1ad04927 \"BufferedImage@1ad04927: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@7d9bc538 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 430 height = 230 #numDataElements 3 dataOff[0] = 2\"]"}
